import React, {
  useState,
  useEffect
} from "react";
import ReactDOM from "react-dom";
import "./index.css";

function GitHubUser({ login }) {
  const [data, setData] = useState(null);
  useEffect(() => {
    // fetch(`https://api.github.com/users/${login}`)
    fetch(`https://jf-na-cdn.justfab.com/image/site/en_US/dm/acquisition/feed/justfab/topconvert/SavageUKTop8LP.json`)
      .then(res => res.json())
      // .then(json => console.log(json))
      .then(setData)
      .catch(console.error);
  }, []);

  if (data) {
    return (
      <div>
        <h1>{data.login}</h1>
        // <img src={data.avatar_url} width={100} />
      </div>
    );
  }
  return null;
}

function App() {
  return <GitHubUser login="moontahoe" />;
}

ReactDOM.render(
  <App />,
  document.getElementById("root")
);
